import React, { Component } from 'react';
import {BrowserRouter as Router, NavLink, Route, Routes} from "react-router-dom";
import Accueil from './components/Accueil';

class App extends Component {


  render() {
  	return(
		<Router>
			<div className="main">
				<header>
					<nav>
						<ul>
							<li><Router to="/yoyo">Accueil</Router></li>
							<li><Router to="/blog">Blog</Router></li>
							<li><Router to="/about">A propos</Router></li>
							<li><Router to="/contact">Contact</Router></li>
						</ul>
					</nav>
				</header>
				<main>
        <Routes>
					<Route exact path="/yoyo" component={Accueil}/>

        </Routes>
				</main>
			</div>
		</Router>
	)
  }
}


export default App;
